import Header from "../components/header.js";
import Footer from "../components/Footer.js";

export default function GameFilm() {
  return (
    <section class="gamefilm-page">
      <Header />
      <div class="content-wrapper w-container">
        <h1 class="page-title">Game Film</h1>
        <div class="w-dyn-list">
          <div class="w-dyn-items w-row">
            <div class="collection-item w-dyn-item w-col w-col-4">
              <h3 class="heading-3"></h3>
              <div class="w-video w-embed"></div>
            </div>
          </div>
        </div>
      </div>
      <style jsx>{`
        .gamefilm-page {
          height: 100vh;
        }
      `}</style>
      <Footer />
    </section>
  );
}
